import './App.scss';
import React, {useState} from "react";
import {BrowserRouter, Route, Routes} from "react-router-dom";
import Home from "./pages/Home";
import homeController, {IHomeController} from "./controller/HomeController";
import NavBar from "./components/NavBar";
import ChangeItem from "./pages/ChangeItem";


function App() {

  const controller: IHomeController = homeController()

  return (
      <div className="App">
        <BrowserRouter>
          <NavBar/>
          <Routes>
            <Route path={"/"} element={<Home controller={controller}/>}/>
            <Route path={"/change/:uuid"} element={<ChangeItem controller={controller}/>}/>
          </Routes>
        </BrowserRouter>
      </div>
  );
}

export default App;
